/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `delete_osoba` BEFORE DELETE ON `osoba` FOR EACH ROW BEGIN
	delete from hobby
	where osoba=old.id;
	
	update zwierzak set id=(
		select id from osoba
		where id<>old.id 
		order by rand()
		limit 1
	)
	where id=old.id;
END */;;
